import Link from 'next/link';
import React, { ReactNode } from 'react';

const UserLink = ({
	className,
	children,
}: {
	className?: string;
	children?: ReactNode;
}) => {
	return (
		<Link href="/users/1">
			{children ? (
				<div className="text-yellow-400">{children}</div>
			) : (
				<a className={`text-yellow-400 font-medium ${className}`}>RiznSun</a>
			)}
		</Link>
	);
};

export default UserLink;
